import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from "react-router-dom";

export default function Third() {
    const [team, setTeam] = useState('');
    const [date, setDate] = useState('');
    const [data, setData] = useState([]);
    const navigate = useNavigate();

    const handleSearch = () => {
        axios.get(`http://localhost:8070/router/get?team=${team}&date=${date}`)
            .then(response => {
                setData(response.data);
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    };

    const handleUpdate = (id) => {
        navigate(`/Update/${id}`);
    };

    const handleDelete = (id) => {
        axios.delete(`http://localhost:8070/router/delete/${id}`)
            .then(response => {
                console.log(response.data);
                setData(data.filter(item => item._id !== id)); // Remove the deleted item from the list
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    };

    return (
        <div>
            <h1>Search Results</h1>
            <label>Team</label>
            <input type="text" value={team} onChange={(e) => setTeam(e.target.value)} /><br/>
            <label>Date</label>
            <input type="date" value={date} onChange={(e) => setDate(e.target.value)} /><br/>
            <button type="button" onClick={handleSearch}>Search</button>

            <ul>
                {data.map(item => (
                    <li key={item._id}>
                        {item.team} - {item.date} - {item.Operatorname} - {item.Operatorgrade} - {item.Operationname} - {item.Operationgrade}
                        <button type="button" onClick={() => handleUpdate(item._id)}>Update</button>
                        <button type="button" onClick={() => handleDelete(item._id)}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}
